import React from 'react';

function ProjectsInfo(props){
    return(
        <div className="divProjectsInfo">
            <div className="divProjectsInfoParticipate">
                <p>Projetos participados</p>
                <p>10</p>
            </div>
            <div className="divProjectsInfoPublic">
                <p>Projetos Publicados</p>
                <p>10523</p>
            </div>
        </div>
    )
}

export default ProjectsInfo;
